CREATE TABLE IF NOT EXISTS project_dataset1_protein_protein (
    `Entry` INT PRIMARY KEY,
    `PDB` VARCHAR(4) CHARACTER SET utf8,
    `Mutations2` VARCHAR(88) CHARACTER SET utf8,
    `Protein_1` VARCHAR(73) CHARACTER SET utf8,
    `Protein_2` VARCHAR(92) CHARACTER SET utf8,
    `Experiment` VARCHAR(86) CHARACTER SET utf8,
    `Temperature` INT,
    `pH` NUMERIC(2, 1),
    `Binding_free_energy_G` NUMERIC(4, 2),
    `Change_in_binding_free_energy_G` NUMERIC(3, 2),
    `Authors` VARCHAR(160) CHARACTER SET utf8,
    `Journal` VARCHAR(29) CHARACTER SET utf8,
    `PubMed_ID` INT
);
